import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, ScrollView, Image } from 'react-native';
import { collection, getDocs } from 'firebase/firestore';
import { db } from '../'; // Update the path as per your project structure

const RentedCarsScreen = () => {
  const [rentedCars, setRentedCars] = useState([]);

  useEffect(() => {
    const fetchRentedCars = async () => {
      try {
        const querySnapshot = await getDocs(collection(db, 'rentedCars'));
        const cars = [];
        querySnapshot.forEach((doc) => {
          cars.push({ id: doc.id, ...doc.data() });
        });
        setRentedCars(cars);
      } catch (error) {
        console.error('Error fetching rented cars:', error);
      }
    };

    fetchRentedCars();
  }, []);

  return (
    <ScrollView style={styles.container}>
      {rentedCars.map((car) => (
        <View key={car.id} style={styles.card}>
          <Text style={styles.title}>{car.make} {car.model}</Text>
          <Text style={styles.text}>Price per day: ${car.price_per_day}</Text>
          <Text style={styles.text}>Rented Date: {car.rentedDate}</Text>
          {/* Add Image or other details as needed */}
        </View>
      ))}
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 10,
  },
  card: {
    backgroundColor: 'white',
    borderRadius: 8,
    padding: 15,
    marginBottom: 10,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 1 },
    shadowOpacity: 0.2,
    shadowRadius: 1,
    elevation: 3,
  },
  title: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 5,
  },
  text: {
    fontSize: 14,
    color: 'gray',
  },
  // Add styles for images and other elements as needed
});

export default RentedCarsScreen;
